import { initializeApp } from "firebase/app";
import { getAnalytics } from "firebase/analytics";
import { getFirestore } from 'firebase/firestore';
// TODO: Add SDKs for Firebase products that you want to use
// https://firebase.google.com/docs/web/setup#available-libraries

// Your web app's Firebase configuration
// For Firebase JS SDK v7.20.0 and later, measurementId is optional
const firebaseConfig = {

  apiKey: "AIzaSyA7E8bNDTQUt7GtzslcFVhUVpz5KL2HknU",
  authDomain: "marcelo-spinola-lb-caf68.firebaseapp.com",
  projectId: "marcelo-spinola-lb-caf68",
  storageBucket: "marcelo-spinola-lb-caf68.appspot.com",
  messagingSenderId: "385443492989",
  appId: "1:385443492989:web:01c1ef88fedb22b50ead14",
  measurementId: "G-FBL6EBWM2Y"
}
// Initialize Firebase
const app = initializeApp(firebaseConfig);
export const analytics = getAnalytics(app);
export const db = getFirestore();
export default app;
